import { useState , useEffect} from 'react';
import Back from './back.jpg';
import './Card.css';

const Card = () => {
  // const [click, handleClick] = useState("");

  const [animeData, setAnimeData] = useState();
  const getData = async()=>{
    const res = await fetch(`https://api.jikan.moe/v4/anime?q=naruto &sfw`);
    const resData = await res.json();

    setAnimeData(resData.data);
  }

  useEffect(()=>{
    getData();

  },[])
  



  return (

    <div className="outer-box">
      <div className='box'>
        <img className='image' src="https://cdn.myanimelist.net/images/anime/13/17405l.jpg" alt="background" />
        <div className='desc-box'>
          <h3 className='title'>Albert hall</h3>
          <div className='underline'></div>
          <p className='desc'>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Odit, delectus?</p>
        </div>
        <div className='underline'></div>
        <button className='btn' onClick='/App'>View More</button>
      </div>



      
      

      
      
    </div>

  )
}

export default Card
